    "gravity-data-for-the-vernal-utah-quad-1x2-degree",nt"isopen": false,nt"url":
    null,nt"notes": "The gravity station data (4,778 records) were gathered by
    various governmental organizations (and academia) using a variety of methods. This
    data base was received in April 1986. Principal gravity parameters include Free-air
    Anomalies and Simple Bouguer Anomalies (no terrain correction applied). The observed
    gravity values are referenced to the International Gravity Standardization Net 1971
    (IGSN 71). The gravity anomaly computation uses the Geodetic Reference System 1967
    (GRS 67) theoretical gravity formula. The data are randomly distributed in and around
    the Vernal (Utah/Colorado) quadrangle.",nt"license_title": null,nt"extras":
